import PropTypes, { object } from "prop-types";
import { Button } from "antd";

const FollowButton = ({ post }) => {
  return (
    <>
      <Button>Follow</Button>
    </>
  );
};

FollowButton.PropTypes = {
  post: PropTypes.shape({
    mainPosts: PropTypes.arrayOf(object),
    imagePaths: PropTypes.arrayOf(object),
    hasMorePosts: PropTypes.bool.isRequired,
    loadPostsLoading: PropTypes.bool.isRequired,
    loadPostsDone: PropTypes.bool.isRequired,
    loadPostsError: PropTypes.oneOf([null]),
    addPostLoading: PropTypes.bool.isRequired,
    addPostDone: PropTypes.bool.isRequired,
    addPostError: PropTypes.oneOf([null]),
    removePostLoading: PropTypes.bool.isRequired,
    removePostDone: PropTypes.bool.isRequired,
    removePostError: PropTypes.oneOf([null]),
    addCommentLoading: PropTypes.bool.isRequired,
    addCommentDone: PropTypes.bool.isRequired,
    addCommentError: PropTypes.oneOf([null]),
  }),
};

export default FollowButton;
